const a={a1:"工具栏显示在受其操作影响的视图上方。",a2:"工具栏会在受其影响的内容上方显示一个层阶。工具栏可以约束自己的宽度以容纳穿过工具栏的内容。",a3:"不要用别的材料把工具栏的操作分隔开，除非它只是暂时显示的，例如菜单和对话框。",a4:"海拔高度",a5:"在应用内容之上",a6:"滚动",a7:"受影响的内容会在工具栏下滚动。",a8:"忽略的内容",a9:"移动屏幕时，可能会有元素暂时覆盖工具栏。",a10:"用法",a11:"工具栏在受其操作影响的材料上方显示一个层阶。当材料在工具栏下方滚动时，工具栏会被限制在固定位置。",a12:"工具栏在其他材料上方显示一个层阶。",a13:"其他材料在滚动时可以覆盖工具栏。",a14:"工具栏会保持和其他材料的接缝，直到工具栏离开屏幕。",a15:"最后，第二个材料在滚动时也可以覆盖工具栏。",a16:"第二个材料在滚动时也可以覆盖工具栏。",a17:"工具栏的左右两侧的操作不会被其他材料分隔开，除了如菜单和对话框之类的临时材料。",a18:"相反，工具栏会限制它们的宽度，以便为在其上经过的材料腾出空间。工具栏上的左右两侧的操作会始终保持在那一侧。",a19:"将工具栏的宽度限制为小于页面的宽度。",a20:"切勿让一个材料被另一个持久显示的材料分隔开。",a21:"工具栏可以和其他材料共用一个接缝。",a22:"在某些情况下，接缝可以转换为层阶，这种变形称为<strong>瀑布</strong>。",a23:"在瀑布变形中，工具栏开始显示接缝，然后提升形成一个层阶。",a24:"Material Design 中的工具栏位于视图上方",a25:"Material Design 中的工具栏固定显示在材料上方",a26:"Material Design 中的工具栏可被其他材料覆盖",a27:"Material Design 中的第二个材料覆盖工具栏",a28:"Material Design 中的工具栏宽度应小于页面宽度",a29:"Material Design 中的材料不应被其他材料分隔",a30:"Material Design 中的工具栏与其他材料共用接缝"};export{a as zhCn};
